import React, { Component } from 'react';
import careerData from './career_data.json';

console.log(careerData);

class Work extends Component {
  render() {
    console.log(this.props.work);
    return (
        <React.Fragment>
          <div className="timeline-block">
            <div className="timeline-ico">
            <img alt src="images/career/decurtis_logo.png" />
              {/* <i className="fa fa-graduation-cap" /> */}
            </div>
            <div className="timeline-header">
              <h3>Front-end Developer</h3>
              <p>July 2014 - June 2015</p>
            </div>
            <div className="timeline-content">
              <h4>Super Cool Agency</h4>
              <p>Lorem ipsum Occaecat do esse ex et dolor culpa nisi ex in magna consectetur nisi cupidatat laboris esse eiusmod deserunt aute do quis velit esse sed Ut proident cupidatat nulla esse cillum laborum occaecat nostrud sit dolor incididunt amet est occaecat nisi incididunt.</p>
            </div>
          </div> {/* /timeline-block */}
        </React.Fragment>
    );
  }
}

export default class Career extends Component {
  render() {
    let workListBlock = '';
 
    if(portfolioData.length > 0) {
      workListBlock = careerData.map( obj => {
        return (
          <Work key={obj.id} work={obj} />
        )
      })
    }

    return (
      <React.Fragment>
      <section id="resume">
        

      <div className="col-twelve">
        <div className="timeline-wrap">
          {workListBlock}
        </div> {/* /timeline-wrap */}   			
      </div> {/* /col-twelve */}
        
        {/* Skills
      ----------------------------------------------- */}
        <div className="row skill">
          <div className="three columns header-col">
            <h1><span>Skills</span></h1>
          </div>
          <div className="nine columns main-col">
            <p>I am creative, innovative that helps in achieve great UX/UI and I am good at management, love to perfection(fast and highly scalable) and according to me process is the key to achieve best.
              Apart from this I am lazy, believe in work with fun and the most problem solver. 
            </p>
            <div className="bars">
              <ul className="skills">
                <li><span className="bar-expand android" /><em>Android</em></li>
                <li><span className="bar-expand java" /><em>Java</em></li>
                <li><span className="bar-expand c-plus-plus" /><em>C++</em></li>
                <li><span className="bar-expand react-js" /><em>React JS</em></li>
                <li><span className="bar-expand photoshop" /><em>Photoshop</em></li>
                {/* <li><span className="bar-expand css" /><em>CSS</em></li>
                <li><span className="bar-expand html5" /><em>HTML5</em></li>
                <li><span className="bar-expand jquery" /><em>jQuery</em></li> */}
              </ul>
            </div>{/* end skill-bars */}
          </div> {/* main-col end */}
        </div> {/* End skills */}
      </section>
      </React.Fragment>
    );
  }
}
